/* Function  structure for function  `getMtChild` */

/*!50003 DROP FUNCTION IF EXISTS `getMtChild` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getMtChild`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE ptemp varchar(1000);
    DECLARE ctemp varchar(1000);
    SET ptemp = '#';
    SET ctemp =cast(rootId as CHAR);
    WHILE ctemp is not null DO
      SET ptemp = concat(ptemp,',',ctemp);
      SELECT group_concat(id) INTO ctemp FROM `material_class`
      WHERE FIND_IN_SET(pid,ctemp)>0;
    END WHILE;
    RETURN ptemp;
  END */$$
DELIMITER ;

/* Function  structure for function  `getStbGroupChild` */

/*!50003 DROP FUNCTION IF EXISTS `getStbGroupChild` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getStbGroupChild`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
 
   
DECLARE ptemp VARCHAR(1000);
   
 DECLARE ctemp VARCHAR(1000);
    
SET ptemp = '#';
   
 SET ctemp =CAST(rootId AS CHAR);
   
 WHILE ctemp IS NOT NULL DO
      
SET ptemp = CONCAT(ptemp,',',ctemp);
     
 SELECT GROUP_CONCAT(id) INTO ctemp FROM `stb_group`
    
  WHERE FIND_IN_SET(parent_id,ctemp)>0;
    
END WHILE;
 
   RETURN ptemp;
  
END */$$
DELIMITER ;

